import React from 'react';
import { AppBar, Toolbar, Typography } from '@material-ui/core';

const NavBar = () => {
    return (
        <div>
            <AppBar position="static">
                <Toolbar>
                    <Typography variant="H1" color="inherit">
                        Rect and material Ui
                    </Typography>
                </Toolbar>
            </AppBar>
        </div>
    )
}

export default NavBar;
